<script nonce="bd81fc965f64ee439f4a83198363f4a5e279b37c">/*
 * @author: Proviso
 * @date: 24/04/2017
 * @summary: JS file to be included in the generated statement output (HTML/PDF)
 *           to override the existing, default presentation.

 */

$(function () {
//auto-toggle-all
    $('.toggleAll').trigger('click');


//Add className to summary containers in order to identify them
    $('.category-group-summary > div > div.heading > span').each(function (i, el) {
        $(el).parent().parent().parent().addClass($(el).text().replace('■  ', '').replace(/\s/g, '_').toLowerCase());
    });

    $('.headerInnerWrapper').each(function (i, el) {
        $(el).find('.category-group-summary.all_other_credits').insertAfter($(el).find('.category-group-summary.centrelink'));
    });

    $('i.squareBlock, .squareBlock > span').each(function (i, el) {
        el = $(el)
        style = el.attr('style')
        style = style.replace('color: F', 'color: #F').replace('color:F', 'color: #F');

        new_style = style.replace(/CBE2A4/i, 'a9db20') 	//wages
            .replace(/f0b722/i, '5dde5a') 	//centrelink
            .replace(/ff7D40/i, '19e091')	//all other credits
            .replace(/db2626/i, 'ff7D40')	//gambling
        el.attr('style', new_style)
    });

//Change background, border and heading colours of categories for easier navigation.
    $('.category-group-summary-inner .heading').each(function (i, el) {
        label_id = $(el).find('span').attr('id')
        if (label_id !== undefined) {
            group_color = $(el).find('.squareBlock').css('color');
            group_color_light = group_color.replace('rgb', 'rgba').replace(')', ', 0.07)')
            $(el).css('border-color', group_color)

            id = label_id.replace('Label', '');
            $('#' + id + 'Summary div').css('border-color', group_color)
            $('#' + id + 'Summary').css('background-color', group_color_light)
            $('#' + id + 'Summary .sacc-loan-heading').css('background-color', group_color_light)
        }
    });

//set bg colours of the main transaction table rows
     $('#transaction-table tr').each(function (i, el) {
         group_color = $(el).find('.squareBlock span').css('color');
         if (group_color !== undefined) {
             group_color_light = group_color.replace('rgb', 'rgba').replace(')', ', 0.2)')
             $(el).css('border-color', group_color)
             $(el).css('background-color', group_color_light)
         }
     });

//add transaction link to whole row of transaction listing
    $('.summary-transaction-table tr').each(function (i, el) {
        el = $(el)

        date_label = el.find('.transaction-data-date a').text();
        href = el.find('.transaction-data-date a').attr('href');
        el.data('ref', href);

        //remove Day name
        date_label = date_label.replace('Mon ', '').replace('Tue ', '').replace('Wed ', '').replace('Thu ', '').replace('Fri ', '').replace('Sat ', '').replace('Sun ', '');
        el.find('.transaction-data-date a').text(date_label)

        el.click(function (e) {
            href = $(this).data('ref')
            window.location = href
        })
    });

//change click event to show transaction listings on category header
    $('.sacc-loan-heading').find('nobr').after('<span class="click-hint">click for transactions</span>')
    $('.sacc-loan-heading').each(function (i, sub_heading) {
        $(sub_heading).click(function () {
            transactions_id = $(this).parent().next("[id$=WrapperDiv]").attr('id');
            if ($('#' + transactions_id).hasClass('displayed')) {
                $('#' + transactions_id).removeClass('displayed')
            } else {
                $('#' + transactions_id).addClass('displayed')
            }
        })
    });

//do some work to the transaction table to make it easier to read
    $('.summary-transaction-table tr:odd').addClass('row-odd');
    $('.summary-transaction-table tr:even').addClass('row-even');

    $('.summary-transaction-table').each(function (i, table) {
        $(table).find('col:first').css('width', '7%')
        $(table).find('col:first').after('<col style="width:7%">')
        $(table).find('col:nth-child(3)').css('width', '75%')
        $(table).find('col:last').remove()

        //add days between dates to assist in frequency matching
        var row_count = $(table).find('tr').length;

        $(table).find('tr').each(function (i, el) {
            $(el).find('td:last').remove()
            date_txt = add_year($(el).find('.transaction-data-date'));
            date_txt_next = add_year($(el).next().find('.transaction-data-date'));
            date = new Date(date_txt);
            date_next = new Date(date_txt_next);

            days_between = ((i < (row_count - 1)) ? parseInt((date - date_next) / (1000 * 60 * 60 * 24)) + " Days" : '').replace(/^1 Days$/, '1 Day');

            $(el).find('.transaction-data-date').after($('<td class="days-between">' + days_between + '</td>'))

        })
    });

    $('.sacc-loans-summary-area .transaction-data-credit').each(function (i, el) {
        el = $(el);
        el.css('font-weight', '900');
        if (el.text().indexOf('-') >= 0) {
            el.css('color', '#d00');
        } else if (el.text().indexOf('DH') >= 0) {
            el.css('color', '#909');
        } else {
            el.css('color', '#080');
        }
    });

//function to add a year to the default date to assist JS Date class
    function add_year(el) {
        return $(el).text() + ' ' + $(el).data('transaction-year');
    }

//styles
    $('body').prepend(
        '<style type="text/css"> ' +
        'body{font-family: Helvetica, Arial, sans-serif} ' +
        '[id$=WrapperLabel]{ display: none!important } ' +
        '.heading > span{ display: block } ' +
        '.heading > span{ width: 100% } ' +
        '.heading > span{ font-weight: 500 } ' +
        '.heading span:after{display: none !important;} ' +
        '.inner-header{ color: #777 } ' +
        '.heading i.squareBlock{ font-size: 37px!important; line-height: 19px!important; padding: 0!important; margin-bottom:-18px!important; position: relative; top: 5px!important; } ' +
        '.days-between {color: #777} ' +
        '.click-hint{ position:absolute; right:15px; top:4px; display:none; font-weight:300; opacity:.5 } ' +
        '.sacc-loan-heading { margin-left:-10px!important; width:calc(100% - 10px)!important; padding: 10px; cursor:pointer; font-weight: 600!important } ' +
        '.sacc-loan-heading .transaction-data-indicator.squareBlock{ display: none!important } ' +
        '.sacc-loan-heading:hover .click-hint{ display:inline!important } ' +
        '.category-group-summary-inner .sacc-loans-summary-area{ padding: 0 0 8px 10px!important } ' +
        '.sacc-loans-summary-area div:first-child{ padding-top: 0!important } ' +
        '.sacc-loans-summary-area span{ padding-bottom: 0!important; } ' +
        '.summary-transaction-table td{ padding: 4px 0 3px 7px!important } ' +
        '.summary-transaction-table:last-child{ margin-bottom: 5px!important; margin-top: 10px!important; width: calc(100% - 15px)!important } ' +
        '.summary-transaction-table tr{ cursor: pointer!important } ' +
        '.summary-transaction-table .transaction-data-date{ width:10% !important; padding-left:10px} ' +
        '.summary-transaction-table .days-between{  width:10% !important} ' +
        '.summary-transaction-table .transaction-data-description{  width:50% !important} ' +
        '.summary-transaction-table .transaction-data-credit{ width:10%!important; min-width:100px; padding:5px 10px 0 0!important; font-weigth:900!important} ' +
        '.summary-transaction-table .row-even{background-color: #ffff88!important } ' +
        '.summary-transaction-table .row-odd{ background-color: #ffffaa!important } ' +
        '.summary-transaction-table tr:hover{background-color: #ffffdd!important } ' +
        '#primary-transaction-section .table {padding:0} ' +
        '#transaction-table tbody tr:target { border-top: 5px solid #FF7D86!important; background-color: #FF7D86!important; }' +
        '.heading span:after { display: none !important; }' +
        '.transaction-data-credit { background-color: rgba(255, 255, 255, 0.0) !important; ; }'+
        '.tablesorter-filter-row td[data-column="5"] { background-color: #fff !important; }'+
        '</style>'
    );

//these styles need JS overrides as the code includes them inline

    $('.sacc-loan-heading').attr('style', function (i, s) {
        return s + 'margin-left: -10px; width: calc(100% - 10px); padding: 8px 10px!important; cursor: pointer; font-weight: 600; font-size:14px; font-weight:400!important'
    });

//showing additional link
    $('.htmlVersion .clickToExpand').show();

});</script><style>body.tablesorter-disableSelection { -ms-user-select: none; -moz-user-select: -moz-none;-khtml-user-select: none; -webkit-user-select: none; user-select: none; }.tablesorter-resizable-container { position: relative; height: 1px; }.tablesorter-resizable-handle { position: absolute; display: inline-block; width: 8px;top: 1px; cursor: ew-resize; z-index: 3; user-select: none; -moz-user-select: none; }</style></head>
